import Inputs from "../../shared/Components/FormElements/Input";
import React from "react";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";

const Dummy_places = [
    {
        id:'p1',
        title:'Empire state Building',
        description:'Tallest Building',
        imageUrl:'https://www.kitano.com/resourcefiles/snippet-main-img/empire-state-building-in-new-york-top.jpg?version=8242023115716',
        address:'20 W 34th St., New York, NY 10001',
        location:"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3022.617356433533!2d-73.98823932426755!3d40.74844453538418!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c259a9b3117469%3A0xd134e199a405a163!2sEmpire%20State%20Building!5e0!3m2!1sen!2sin!4v1701432335622!5m2!1sen!2sin",
        creatorId:'u1',

    },
    {
        id:'p2',
        title:'Empire state Building',
        description:'Tallest Building',
        imageUrl:'https://www.kitano.com/resourcefiles/snippet-main-img/empire-state-building-in-new-york-top.jpg?version=8242023115716',
        address:'20 W 34th St., New York, NY 10001',
        location:"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3022.617356433533!2d-73.98823932426755!3d40.74844453538418!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c259a9b3117469%3A0xd134e199a405a163!2sEmpire%20State%20Building!5e0!3m2!1sen!2sin!4v1701432335622!5m2!1sen!2sin",
        creatorId:'u2',

    },
]


const UpdatePlace = () => {

    const placeId = useParams().placeId;
    const IdentifierPlace = Dummy_places.find(p => p.id === placeId);

    if(!IdentifierPlace){
        return (
        <div className="center">
            <h2>Place Not Found</h2>
        </div>
        );
    }

    return <form>
        <Inputs id="Title" inputfieldtype="input" type="text" label="Title" errorText="Please enter a valid title" onInput={inputHandler}/>
    </form>;
}

export default UpdatePlace;
